import './ArrowDown.scss';

export default function ArrowDown(props) {
  return (
    <HashLink to={`#${props.path}`}>
        <div class="container">
          <div class="chevron"></div>
          <div class="chevron"></div>
          <div class="chevron"></div>
        </div>
    </HashLink>
  )
}
